import { useNavigate } from "react-router-dom"
export const AddProduct = () => {
    const navigate = useNavigate()

    const handleNavigate = () => {
        navigate('/productdetails')
    }
    return (
        <button onClick={handleNavigate}>
                add a new product

            </button>

    )
}
